crawl_links=False
class QuotesSpider(scrapy.Spider):
    name = "mamyfoodspider"

    start_urls = [
        'https://mamifood.org/cooking-training'
    ]
    all_url = set()
    all_page = set()
    mamy = 0

    def parse_page(self, response):
        page_num = response.xpath('//a[@class="aspNetDisabled current"]/text()').extract()[0]
        if page_num in self.all_page:
            return
        self.all_page.add(page_num)
        foods_link = []
        for link in response.xpath('//article[@id="Table"]/a/@href').extract():
            food = response.urljoin(link)
            if food not in self.all_url:
                self.all_url.add(food)
                foods_link.append(food)

        print("crawl for link", page_num, len(foods_link))
        for step, food in enumerate(foods_link):
            data = {}
            data["link"] = food
            yield data
            # yield scrapy.Request(food, callback=self.parser_food_page)

